class TracenacUserModelClass {  bool? status;  List<Msg>? msg;  TracenacUserModelClass({this.status, this.msg});  TracenacUserModelClass.fromJson(Map<String, dynamic> json) {    status = json['status'];    if (json['msg'] != null) {      msg = <Msg>[];      json['msg'].forEach((v) {        msg!.add(Msg.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['status'] = status;    if (msg != null) {      data['msg'] = msg!.map((v) => v.toJson()).toList();    }    return data;  }}class Msg {  String? id;  String? tenantId;  String? email;  String? name;  int? phone;  int? lastLogin;  String? userRole;  String? createdAt;  String? updatedAt;  Msg(      {this.id,        this.tenantId,        this.email,        this.name,        this.phone,        this.lastLogin,        this.userRole,        this.createdAt,        this.updatedAt});  Msg.fromJson(Map<String, dynamic> json) {    id = json['id'];    tenantId = json['tenantId'];    email = json['email'];    name = json['name'];    phone = json['phone'];    lastLogin = json['lastLogin'];    userRole = json['userRole'];    createdAt = json['createdAt'];    updatedAt = json['updatedAt'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['id'] = id;    data['tenantId'] = tenantId;    data['email'] = email;    data['name'] = name;    data['phone'] = phone;    data['lastLogin'] = lastLogin;    data['userRole'] = userRole;    data['createdAt'] = createdAt;    data['updatedAt'] = updatedAt;    return data;  }}